import React, {Component, useState, useEffect} from 'react';
import {Button, Image, Card, CardDeck, ListGroup, CardColumns} from 'react-bootstrap';
import '../css/Blog.css';
import { BrowserRouter as Router, Route} from "react-router-dom";
import CreateBlogList from './BlogComponents/CreateBlogList';

function Blog(props){
	var state = useState();
	return(
		<div className="container_blog">
			<Button variant="primary" href='/blog/create'>Add Blog</Button>
			<Router>
				<Route path="/blog/create" component={CreateBlogList}></Route>
			</Router>
			<CardDeck>
				<Card>
					<Card.Img variant="top" src="holder.js/100px160" />
					<Card.Body>
					<Card.Title>1</Card.Title>
					<Card.Text>
						This is a wider card with supporting text below as a natural lead-in to
						additional content. This content is a little bit longer.
					</Card.Text>
					</Card.Body>
					<Card.Footer>
					<small className="text-muted">Last updated 3 mins ago</small>
					</Card.Footer>
				</Card>
			</CardDeck>
		</div>
		);

}

export default Blog;
